const fs = require("fs");
const data = fs.readFileSync("../../dataset.json");
console.log(data);

const defaultState = {
    notebooks: data,
};

const dataReducer = (state = defaultState, action) => {
    switch (action.type) {
        default:
            return state;
    }
};

export default dataReducer;
